import React from "react";
import './menu-item.styles.css';
 
const MenuItem=({title})=>(
   <div className="content">
    <div className="menu-item">
    
    <h1 className="title">
        {title}
     </h1>
     <span className="subtitle">
        Shop Now
     </span>
    </div>
    
  </div>
);
export default MenuItem;
